import {React, useState} from 'react'
import Blog from './Blog'

const BlogList = ({ blogs }) => {
  const [view, setView] = useState(false)

  const toggleView = () => {
    console.log('click');
    setView(!view)
  }
  return (
    <div>
      {blogs.map(blog => (
        <div>
          <Blog key={blog.id} blog={blog} />
          <button onClick={toggleView}>view</button>
        </div>
      ))}
    </div>
  )
}

export default BlogList
